import React from 'react'
import { useEffect, useRef } from 'react'
import * as THREE from "three";
import CircleType from "circletype";


const Header = () => {

    useEffect(()=> {
        class webgl{
            constructor(){
                this.container = this.container = document.querySelector('main');
                console.log(this.container)
            }
        }
        new webgl();
    })

    return (
        <div>
            <main>
                <div className="hero">
                <div className="hero-title">
                    <h1>
                    <span class="hero__nine">NINE</span> 
                    <br/> 
                    <span class="hero__fifty">FIFTY</span>
                    <br/>
                    <span class="her__store">STORE</span>
                    </h1>
                </div>
                </div>
            </main>

        </div>
    )
}

export default Header
